import React from 'react'

export default function List({item, handleClick}) {
    return (
        <div>
            <ul>
                    {item.map((add, i) => <li key={i}>{add}<label onClick={handleClick}>&#10060;</label></li> )}
            </ul>
        </div>
    )
}
